import "../styles/LogIn.css"
import { ContextProvider, Context } from "../statemanagement/Context";
import React, { useContext } from "react";

const LogIn = () => {

    const {signIn} = useContext(Context)

    return (
      <div className="login">
        <img src="https://www.sirensearch.co.uk/wp-content/uploads/2020/05/Linkedin-FB.jpg" alt="" />
        <button onClick={signIn}>Lütfen giriş yapabilir miyim</button>
      </div>
    );
}

export default LogIn
